sys_variable_value.value:
(function execute(inputs, outputs) {
  var reqUtil = new Request()
  var errUtil = new ErrorHandler()
  var response;

  // Have to remove an extra escape character from the Name/Value object for some reason
  var extraHeaderString = inputs.extraHeaders ? inputs.extraHeaders.replaceAll("\\", "") : null;
  try {
    var request = {
      contentType: inputs.contentType,
      endpoint: inputs.baseUrl + inputs.resourcePath,
      method: inputs.method ? inputs.method.toLowerCase().trim() : "get",
      mutualAuth: inputs.mutualAuth,
      token: inputs.token,
      body: inputs.requestBody,
      extraHeaders: extraHeaderString ? JSON.parse(extraHeaderString) : null
    };

    response = reqUtil.checkResponseCode([200], reqUtil.makeRequest(request));

    outputs.response_status = response.statusCode;
    outputs.response_body = response.body;

 } catch (error) {
    errUtil.errorLogger(error);    
 }

})(inputs, outputs);

